import React from 'react';
import BER from '../images/Bruce-new-heashot1.jpg';

function Team(props) {
    return (
        <div>
            <section>
                <p>We believe our team outshines the rest!</p>
            </section>

           <section className="Tsec1">
                <div>
                <h4>Dr. Bruce E. Ruben</h4>
                <p>Triple board certified in Internal Medicine, Infectious Disease, and Undersea Hyperbaric Medicine, Dr. Ruben is our Medical Director, owner, and founder.</p>
                </div>
                <img src={BER} alt="Dr. Bruce Ruben Headshot" className="Tsec1Pic"/>
            </section> 

            <section className="Tsec1">
                <img src={BER} alt="Dr. Bruce Ruben Headshot" className="Tsec1Pic"/>
                <p>As Metro-Detroit's only full-service wound healing & infection facility, we're equipped with hosipital-quality modalities while giving patients the flexibility of outpatient care.</p>
            </section> 


        </div>
    );
}

export default Team;
